import React from "react";
import { Nav, Navbar, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="header">
    <Navbar fixed="top" variant="dark">
      <Link className="navbar-brand" to="/">NNN</Link>
      <Nav className="ml-auto">
        <Link className="nav-link mr-2" to="/about">What is this?</Link>
        <Link className="nav-link mr-3" to="/rules">NNN Rules</Link>
        <Button className="join-button" variant="danger">Join The Boys</Button>
      </Nav>
    </Navbar>
  </header>
  );
}

export default Header;
